import styled from 'styled-components';

export const Container = styled.div`
  display: flex;
  justify-content: space-evenly;
  font-size: 14px;

  margin-top: 10px;
`;

export const ListItens = styled.ul`
  display: flex;
  flex-direction: column;
  justify-content: space-around;
`;
